import{_ as r,E as e,ag as o,D as t}from"./chunks/framework.lDRhkpKe.js";const c=JSON.parse('{"title":"常见问题解答 (FAQ)","description":"","frontmatter":{"layout":"home","footer":true,"title":"常见问题解答 (FAQ)"},"headers":[],"relativePath":"faq.md","filePath":"faq.md"}'),l={name:"faq.md"};function i(d,a,n,m,s,x){return t(),e("div",null,a[0]||(a[0]=[o('<h1 id="常见问题解答-faq" tabindex="-1">常见问题解答 (FAQ) <a class="header-anchor" href="#常见问题解答-faq" aria-label="Permalink to &quot;常见问题解答 (FAQ)&quot;">​</a></h1><h3 id="_1-孵化流程" tabindex="-1">1. 孵化流程 <a class="header-anchor" href="#_1-孵化流程" aria-label="Permalink to &quot;1. 孵化流程&quot;">​</a></h3><h4 id="_1-1-项目x必须通过孵化器进入dromara吗" tabindex="-1">1.1 项目X必须通过孵化器进入Dromara吗？ <a class="header-anchor" href="#_1-1-项目x必须通过孵化器进入dromara吗" aria-label="Permalink to &quot;1.1 项目X必须通过孵化器进入Dromara吗？&quot;">​</a></h4><p>是的。从dromara 开源组织外部引入的代码只能通过孵化器进入dromara 开源组织。孵化器负责以下工作：</p><ul><li>确认许可证符合要求；</li><li>要求所有初始开发者提交CLA（贡献者许可协议）。</li><li>更改项目包名和包路径(org.dromara.xxx)。</li><li>如果需要发布到MavenRepo，需要由IPMC批准。并且更改 groupId 为org.dromara。</li></ul><h4 id="_1-2-为什么项目xxx没有提到孵化器-该怎么迁移到dromara的xxx项目下" tabindex="-1">1.2 为什么项目XXX没有提到孵化器？该怎么迁移到Dromara的XXX项目下？ <a class="header-anchor" href="#_1-2-为什么项目xxx没有提到孵化器-该怎么迁移到dromara的xxx项目下" aria-label="Permalink to &quot;1.2 为什么项目XXX没有提到孵化器？该怎么迁移到Dromara的XXX项目下？&quot;">​</a></h4><p>孵化过程的职责划分如下：</p><ol><li>项目进入孵化器需要某个Dromara TOC 成员（包括IPMC）作为发起人；</li><li>一旦IPMC接管，指定的导师将负责监督项目的孵化进度；</li><li>项目需每季度向IPMC提交进展报告，直到毕业为止；</li><li>毕业后，如果是其他PMC发起的项目，它将转交给发起PMC，否则需董事会批准成立独立PMC。</li></ol><p>要迁移到XXX项目，请先请求XXX PMC担任你的项目发起人，随后进入孵化流程。</p>',9)]))}const X=r(l,[["render",i]]);export{c as __pageData,X as default};
